import{_ as a,c as i,o as e,a as r}from"./app.c6313f78.js";const J='{"title":"\u4EC0\u4E48\u662F JavaScript","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u5B83\u662F\u4E00\u4E2A...","slug":"\u5B83\u662F\u4E00\u4E2A"},{"level":2,"title":"\u5F15\u64CE","slug":"\u5F15\u64CE"},{"level":2,"title":"\u6D4F\u89C8\u5668\u4E2D\u7684 JavaScript \u80FD\u5E72\u561B\uFF1F","slug":"\u6D4F\u89C8\u5668\u4E2D\u7684-javascript-\u80FD\u5E72\u561B\uFF1F"},{"level":2,"title":"\u6D4F\u89C8\u5668\u4E2D\u7684 JavaScript \u4E0D\u80FD\u5E72\u561B\uFF1F","slug":"\u6D4F\u89C8\u5668\u4E2D\u7684-javascript-\u4E0D\u80FD\u5E72\u561B\uFF1F"},{"level":2,"title":"\u662F\u4EC0\u4E48\u8BA9 JavaScript \u4E0E\u4F17\u4E0D\u540C\uFF1F","slug":"\u662F\u4EC0\u4E48\u8BA9-javascript-\u4E0E\u4F17\u4E0D\u540C\uFF1F"}],"relativePath":"javascript/what_is_js.md"}',t={name:"javascript/what_is_js.md"},p=r('<h1 id="\u4EC0\u4E48\u662F-javascript" tabindex="-1">\u4EC0\u4E48\u662F JavaScript <a class="header-anchor" href="#\u4EC0\u4E48\u662F-javascript" aria-hidden="true">#</a></h1><h2 id="\u5B83\u662F\u4E00\u4E2A" tabindex="-1">\u5B83\u662F\u4E00\u4E2A... <a class="header-anchor" href="#\u5B83\u662F\u4E00\u4E2A" aria-hidden="true">#</a></h2><p><em>JavaScript</em> \u6700\u521D\u88AB\u521B\u5EFA\u7684\u76EE\u7684\u662F\u201C\u4F7F\u7F51\u9875\u66F4\u751F\u52A8\u201D\u3002</p><p>\u8FD9\u79CD\u7F16\u7A0B\u8BED\u8A00\u5199\u51FA\u6765\u7684\u7A0B\u5E8F\u88AB\u79F0\u4E3A <strong>\u811A\u672C</strong>\u3002\u5B83\u4EEC\u53EF\u4EE5\u88AB\u76F4\u63A5\u5199\u5728\u7F51\u9875\u7684 HTML \u4E2D\uFF0C\u5728\u9875\u9762\u52A0\u8F7D\u7684\u65F6\u5019\u81EA\u52A8\u6267\u884C\u3002</p><p>\u811A\u672C\u88AB\u4EE5\u7EAF\u6587\u672C\u7684\u5F62\u5F0F\u63D0\u4F9B\u548C\u6267\u884C\u3002\u5B83\u4EEC\u4E0D\u9700\u8981\u7279\u6B8A\u7684\u51C6\u5907\u6216\u7F16\u8BD1\u5373\u53EF\u8FD0\u884C\u3002</p><div class="tip custom-block"><p class="custom-block-title">JavaScript \u4E0E Java \uFF1F</p><p>JavaScript \u5728\u521A\u8BDE\u751F\u7684\u65F6\u5019\uFF0C\u5B83\u7684\u540D\u5B57\u53EB \u201CLiveScript\u201D\u3002\u4F46\u662F\u56E0\u4E3A\u5F53\u65F6 Java \u5F88\u6D41\u884C\uFF0C\u6240\u4EE5\u51B3\u5B9A\u5C06\u4E00\u79CD\u65B0\u8BED\u8A00\u5B9A\u4F4D\u4E3A Java \u7684\u201C\u5F1F\u5F1F\u201D\u4F1A\u6709\u52A9\u4E8E\u5B83\u7684\u6D41\u884C\u3002</p><p>\u968F\u7740 JavaScript \u7684\u53D1\u5C55\uFF0C\u5B83\u5DF2\u7ECF\u6210\u4E3A\u4E86\u4E00\u95E8\u5B8C\u5168\u72EC\u7ACB\u7684\u8BED\u8A00\uFF0C\u5E76\u4E14\u4E5F\u62E5\u6709\u4E86\u81EA\u5DF1\u7684\u8BED\u8A00\u89C4\u8303 <a href="http://en.wikipedia.org/wiki/ECMAScript" target="_blank" rel="noopener noreferrer">ECMAScript</a>\u3002\u73B0\u5728\uFF0C\u5B83\u548C Java \u4E4B\u95F4\u6CA1\u6709\u4EFB\u4F55\u5173\u7CFB\u3002</p></div><h2 id="\u5F15\u64CE" tabindex="-1">\u5F15\u64CE <a class="header-anchor" href="#\u5F15\u64CE" aria-hidden="true">#</a></h2><p>\u5982\u4ECA\uFF0CJavaScript \u4E0D\u4EC5\u53EF\u4EE5\u5728\u6D4F\u89C8\u5668\u4E2D\u6267\u884C\uFF0C\u4E5F\u53EF\u4EE5\u5728\u670D\u52A1\u7AEF\u6267\u884C\uFF0C\u751A\u81F3\u53EF\u4EE5\u5728\u4EFB\u610F\u642D\u8F7D\u4E86 <a href="https://en.wikipedia.org/wiki/JavaScript_engine" target="_blank" rel="noopener noreferrer">JavaScript \u5F15\u64CE</a> \u7684\u8BBE\u5907\u4E2D\u6267\u884C\u3002</p><p>\u6D4F\u89C8\u5668\u4E2D\u5D4C\u5165\u4E86 JavaScript \u5F15\u64CE\uFF0C\u6709\u65F6\u4E5F\u79F0\u4F5C\u201CJavaScript \u865A\u62DF\u673A\u201D\u3002</p><p>\u4E0D\u540C\u7684\u5F15\u64CE\u6709\u4E0D\u540C\u7684\u201C\u4EE3\u53F7\u201D\uFF0C\u4F8B\u5982\uFF1A</p><ul><li><a href="https://en.wikipedia.org/wiki/V8_(JavaScript_engine)" target="_blank" rel="noopener noreferrer">V8</a> \u2014\u2014 Chrome\u3001Opera \u548C Edge \u4E2D\u7684 JavaScript \u5F15\u64CE\u3002</li><li><a href="https://en.wikipedia.org/wiki/SpiderMonkey" target="_blank" rel="noopener noreferrer">SpiderMonkey</a> \u2014\u2014 Firefox \u4E2D\u7684 JavaScript \u5F15\u64CE\u3002</li><li>\u2026\u2026\u8FD8\u6709\u5176\u4ED6\u4E00\u4E9B\u4EE3\u53F7\uFF0C\u50CF \u201CChakra\u201D \u7528\u4E8E IE\uFF0C\u201CJavaScriptCore\u201D\u3001\u201CNitro\u201D \u548C \u201CSquirrelFish\u201D \u7528\u4E8E Safari\uFF0C\u7B49\u7B49\u3002</li></ul><p>\u4E0A\u9762\u8FD9\u4E9B\u672F\u8BED\u201C\u5F88\u5BB9\u6613\u8BB0\u4F4F\u201D\uFF0C\u5B83\u4EEC\u7ECF\u5E38\u51FA\u73B0\u5728\u5F00\u53D1\u8005\u7684\u6587\u7AE0\u4E2D\u3002\u6211\u4EEC\u4E5F\u4F1A\u7528\u5230\u8FD9\u4E9B\u672F\u8BED\u3002\u4F8B\u5982\uFF0C\u5982\u679C\u201CV8 \u652F\u6301\u67D0\u4E2A\u529F\u80FD\u201D\uFF0C\u90A3\u4E48\u6211\u4EEC\u53EF\u4EE5\u8BA4\u4E3A\u8FD9\u4E2A\u529F\u80FD\u5927\u6982\u80FD\u5728 Chrome\u3001Opera \u548C Edge \u4E2D\u6B63\u5E38\u8FD0\u884C\u3002</p><div class="tip custom-block"><p class="custom-block-title">\u5F15\u64CE\u662F\u5982\u4F55\u5DE5\u4F5C\u7684\uFF1F</p><p>\u5F15\u64CE\u5F88\u590D\u6742\uFF0C\u4F46\u662F\u57FA\u672C\u539F\u7406\u5F88\u7B80\u5355\u3002</p><ol><li>\u5F15\u64CE\uFF08\u5982\u679C\u662F\u6D4F\u89C8\u5668\uFF0C\u5219\u5F15\u64CE\u88AB\u5D4C\u5165\u5728\u5176\u4E2D\uFF09\u8BFB\u53D6\uFF08\u201C\u89E3\u6790\u201D\uFF09\u811A\u672C\u3002</li><li>\u7136\u540E\uFF0C\u5F15\u64CE\u5C06\u811A\u672C\u8F6C\u5316\uFF08\u201C\u7F16\u8BD1\u201D\uFF09\u4E3A\u673A\u5668\u8BED\u8A00\u3002</li><li>\u7136\u540E\uFF0C\u673A\u5668\u4EE3\u7801\u5FEB\u901F\u5730\u6267\u884C\u3002</li></ol><p>\u5F15\u64CE\u4F1A\u5BF9\u6D41\u7A0B\u4E2D\u7684\u6BCF\u4E2A\u9636\u6BB5\u90FD\u8FDB\u884C\u4F18\u5316\u3002\u5B83\u751A\u81F3\u53EF\u4EE5\u5728\u7F16\u8BD1\u7684\u811A\u672C\u8FD0\u884C\u65F6\u76D1\u89C6\u5B83\uFF0C\u5206\u6790\u6D41\u7ECF\u8BE5\u811A\u672C\u7684\u6570\u636E\uFF0C\u5E76\u6839\u636E\u83B7\u5F97\u7684\u4FE1\u606F\u8FDB\u4E00\u6B65\u4F18\u5316\u673A\u5668\u4EE3\u7801\u3002</p></div><h2 id="\u6D4F\u89C8\u5668\u4E2D\u7684-javascript-\u80FD\u5E72\u561B\uFF1F" tabindex="-1">\u6D4F\u89C8\u5668\u4E2D\u7684 JavaScript \u80FD\u5E72\u561B\uFF1F <a class="header-anchor" href="#\u6D4F\u89C8\u5668\u4E2D\u7684-javascript-\u80FD\u5E72\u561B\uFF1F" aria-hidden="true">#</a></h2><p>\u73B0\u4EE3\u7684 JavaScript \u662F\u4E00\u79CD\u201C\u5B89\u5168\u7684\u201D\u7F16\u7A0B\u8BED\u8A00\u3002\u5B83\u4E0D\u63D0\u4F9B\u5BF9\u5185\u5B58\u6216 CPU \u7684\u5E95\u5C42\u8BBF\u95EE\uFF0C\u56E0\u4E3A\u5B83\u6700\u521D\u662F\u4E3A\u6D4F\u89C8\u5668\u521B\u5EFA\u7684\uFF0C\u4E0D\u9700\u8981\u8FD9\u4E9B\u529F\u80FD\u3002</p><p>JavaScript \u7684\u80FD\u529B\u5F88\u5927\u7A0B\u5EA6\u4E0A\u53D6\u51B3\u4E8E\u5B83\u8FD0\u884C\u7684\u73AF\u5883\u3002\u4F8B\u5982\uFF0C<a href="https://wikipedia.org/wiki/Node.js" target="_blank" rel="noopener noreferrer">Node.js</a> \u652F\u6301\u5141\u8BB8 JavaScript \u8BFB\u53D6/\u5199\u5165\u4EFB\u610F\u6587\u4EF6\uFF0C\u6267\u884C\u7F51\u7EDC\u8BF7\u6C42\u7B49\u7684\u51FD\u6570\u3002</p><p>\u6D4F\u89C8\u5668\u4E2D\u7684 JavaScript \u53EF\u4EE5\u505A\u4E0E\u7F51\u9875\u64CD\u4F5C\u3001\u7528\u6237\u4EA4\u4E92\u548C Web \u670D\u52A1\u5668\u76F8\u5173\u7684\u6240\u6709\u4E8B\u60C5\u3002</p><p>\u4F8B\u5982\uFF0C\u6D4F\u89C8\u5668\u4E2D\u7684 JavaScript \u53EF\u4EE5\u505A\u4E0B\u9762\u8FD9\u4E9B\u4E8B\uFF1A</p><ul><li><p>\u5728\u7F51\u9875\u4E2D\u6DFB\u52A0\u65B0\u7684 HTML\uFF0C\u4FEE\u6539\u7F51\u9875\u5DF2\u6709\u5185\u5BB9\u548C\u7F51\u9875\u7684\u6837\u5F0F\u3002</p></li><li><p>\u54CD\u5E94\u7528\u6237\u7684\u884C\u4E3A\uFF0C\u54CD\u5E94\u9F20\u6807\u7684\u70B9\u51FB\uFF0C\u6307\u9488\u7684\u79FB\u52A8\uFF0C\u6309\u952E\u7684\u6309\u52A8\u3002</p></li><li><p>\u5411\u8FDC\u7A0B\u670D\u52A1\u5668\u53D1\u9001\u7F51\u7EDC\u8BF7\u6C42\uFF0C\u4E0B\u8F7D\u548C\u4E0A\u4F20\u6587\u4EF6\uFF08\u6240\u8C13\u7684 <a href="https://en.wikipedia.org/wiki/Ajax_(programming)" target="_blank" rel="noopener noreferrer">AJAX</a> \u6280\u672F\uFF09\u3002</p></li><li><p>\u83B7\u53D6\u6216\u8BBE\u7F6E cookie\uFF0C\u5411\u8BBF\u95EE\u8005\u63D0\u51FA\u95EE\u9898\u6216\u53D1\u9001\u6D88\u606F\u3002</p><blockquote><p>Cookie \u5E76\u4E0D\u662F\u5B83\u7684\u539F\u610F\u201C\u751C\u997C\u201D\u7684\u610F\u601D, \u800C\u662F\u4E00\u4E2A\u4FDD\u5B58\u5728\u7528\u6237\u7EC8\u7AEF\u4E2D\u7684\u7B80\u5355\u7684\u6587\u672C\u6587\u4EF6</p></blockquote></li><li><p>\u8BB0\u4F4F\u5BA2\u6237\u7AEF\u7684\u6570\u636E\uFF08\u201C\u672C\u5730\u5B58\u50A8\u201D\uFF09\u3002</p></li></ul><h2 id="\u6D4F\u89C8\u5668\u4E2D\u7684-javascript-\u4E0D\u80FD\u5E72\u561B\uFF1F" tabindex="-1">\u6D4F\u89C8\u5668\u4E2D\u7684 JavaScript \u4E0D\u80FD\u5E72\u561B\uFF1F <a class="header-anchor" href="#\u6D4F\u89C8\u5668\u4E2D\u7684-javascript-\u4E0D\u80FD\u5E72\u561B\uFF1F" aria-hidden="true">#</a></h2><p>\u4E3A\u4E86\u7528\u6237\u7684\uFF08\u4FE1\u606F\uFF09\u5B89\u5168\uFF0C\u5728\u6D4F\u89C8\u5668\u4E2D\u7684 JavaScript \u7684\u80FD\u529B\u662F\u53D7\u9650\u7684\u3002\u76EE\u7684\u662F\u9632\u6B62\u6076\u610F\u7F51\u9875\u83B7\u53D6\u7528\u6237\u79C1\u4EBA\u4FE1\u606F\u6216\u635F\u5BB3\u7528\u6237\u6570\u636E\u3002</p><p>\u6B64\u7C7B\u9650\u5236\u7684\u4F8B\u5B50\u5305\u62EC\uFF1A</p><ul><li><p>\u7F51\u9875\u4E2D\u7684 JavaScript \u4E0D\u80FD\u8BFB\u3001\u5199\u3001\u590D\u5236\u548C\u6267\u884C\u786C\u76D8\u4E0A\u7684\u4EFB\u610F\u6587\u4EF6\u3002\u5B83\u6CA1\u6709\u76F4\u63A5\u8BBF\u95EE\u64CD\u4F5C\u7CFB\u7EDF\u7684\u529F\u80FD\u3002</p><p>\u73B0\u4EE3\u6D4F\u89C8\u5668\u5141\u8BB8 JavaScript \u505A\u4E00\u4E9B\u6587\u4EF6\u76F8\u5173\u7684\u64CD\u4F5C\uFF0C\u4F46\u662F\u8FD9\u4E2A\u64CD\u4F5C\u662F\u53D7\u5230\u9650\u5236\u7684\u3002\u4EC5\u5F53\u7528\u6237\u505A\u51FA\u7279\u5B9A\u7684\u884C\u4E3A\uFF0CJavaScript \u624D\u80FD\u64CD\u4F5C\u8FD9\u4E2A\u6587\u4EF6\u3002\u4F8B\u5982\uFF0C\u7528\u6237\u628A\u6587\u4EF6\u201C\u62D6\u653E\u201D\u5230\u6D4F\u89C8\u5668\u4E2D\uFF0C\u6216\u8005\u901A\u8FC7 <code>&lt;input&gt;</code> \u6807\u7B7E\u9009\u62E9\u4E86\u6587\u4EF6\u3002</p><p>\u6709\u5F88\u591A\u4E0E\u76F8\u673A/\u9EA6\u514B\u98CE\u548C\u5176\u5B83\u8BBE\u5907\u8FDB\u884C\u4EA4\u4E92\u7684\u65B9\u5F0F\uFF0C\u4F46\u662F\u8FD9\u4E9B\u90FD\u9700\u8981\u83B7\u5F97\u7528\u6237\u7684\u660E\u786E\u8BB8\u53EF\u3002\u56E0\u6B64\uFF0C\u542F\u7528\u4E86 JavaScript \u7684\u7F51\u9875\u5E94\u8BE5\u4E0D\u4F1A\u5077\u5077\u5730\u542F\u52A8\u7F51\u7EDC\u6444\u50CF\u5934\u89C2\u5BDF\u4F60\uFF0C\u5E76\u628A\u4F60\u7684\u4FE1\u606F\u53D1\u9001\u5230 <a href="https://en.wikipedia.org/wiki/National_Security_Agency" target="_blank" rel="noopener noreferrer">\u7F8E\u56FD\u56FD\u5BB6\u5B89\u5168\u5C40...</a>\u3002</p></li><li><p>\u4E0D\u540C\u7684\u6807\u7B7E\u9875/\u7A97\u53E3\u4E4B\u95F4\u901A\u5E38\u4E92\u4E0D\u4E86\u89E3\u3002\u6709\u65F6\u5019\uFF0C\u4E5F\u4F1A\u6709\u4E00\u4E9B\u8054\u7CFB\uFF0C\u4F8B\u5982\u4E00\u4E2A\u6807\u7B7E\u9875\u901A\u8FC7 JavaScript \u6253\u5F00\u7684\u53E6\u5916\u4E00\u4E2A\u6807\u7B7E\u9875\u3002\u4F46\u5373\u4F7F\u5728\u8FD9\u79CD\u60C5\u51B5\u4E0B\uFF0C\u5982\u679C\u4E24\u4E2A\u6807\u7B7E\u9875\u6253\u5F00\u7684\u4E0D\u662F\u540C\u4E00\u4E2A\u7F51\u7AD9\uFF08\u57DF\u540D\u3001\u534F\u8BAE\u6216\u8005\u7AEF\u53E3\u4EFB\u4E00\u4E0D\u76F8\u540C\u7684\u7F51\u7AD9\uFF09\uFF0C\u5B83\u4EEC\u90FD\u4E0D\u80FD\u76F8\u4E92\u901A\u4FE1\u3002</p><p>\u8FD9\u5C31\u662F\u6240\u8C13\u7684\u201C\u540C\u6E90\u7B56\u7565\u201D\u3002\u4E3A\u4E86\u89E3\u51B3\u201C\u540C\u6E90\u7B56\u7565\u201D\u95EE\u9898\uFF0C\u4E24\u4E2A\u6807\u7B7E\u9875\u5FC5\u987B <strong>\u90FD</strong> \u5305\u542B\u4E00\u4E9B\u5904\u7406\u8FD9\u4E2A\u95EE\u9898\u7684\u7279\u5B9A\u7684 JavaScript \u4EE3\u7801\uFF0C\u5E76\u5747\u5141\u8BB8\u6570\u636E\u4EA4\u6362\u3002\u672C\u6559\u7A0B\u4F1A\u8BB2\u5230\u8FD9\u90E8\u5206\u76F8\u5173\u7684\u77E5\u8BC6\u3002</p><p>\u8FD9\u4E2A\u9650\u5236\u4E5F\u662F\u4E3A\u4E86\u7528\u6237\u7684\u4FE1\u606F\u5B89\u5168\u3002\u4F8B\u5982\uFF0C\u7528\u6237\u6253\u5F00\u7684 <code>http://anysite.com</code> \u7F51\u9875\u5FC5\u987B\u4E0D\u80FD\u8BBF\u95EE <code>http://gmail.com</code>\uFF08\u53E6\u5916\u4E00\u4E2A\u6807\u7B7E\u9875\u6253\u5F00\u7684\u7F51\u9875\uFF09\u4E5F\u4E0D\u80FD\u4ECE\u90A3\u91CC\u7A83\u53D6\u4FE1\u606F\u3002</p></li><li><p>JavaScript \u53EF\u4EE5\u8F7B\u677E\u5730\u901A\u8FC7\u4E92\u8054\u7F51\u4E0E\u5F53\u524D\u9875\u9762\u6240\u5728\u7684\u670D\u52A1\u5668\u8FDB\u884C\u901A\u4FE1\u3002\u4F46\u662F\u4ECE\u5176\u4ED6\u7F51\u7AD9/\u57DF\u7684\u670D\u52A1\u5668\u4E2D\u63A5\u6536\u6570\u636E\u7684\u80FD\u529B\u88AB\u524A\u5F31\u4E86\u3002\u5C3D\u7BA1\u53EF\u4EE5\uFF0C\u4F46\u662F\u9700\u8981\u6765\u81EA\u8FDC\u7A0B\u670D\u52A1\u5668\u7684\u660E\u786E\u534F\u8BAE\uFF08\u5728 HTTP header \u4E2D\uFF09\u3002\u8FD9\u4E5F\u662F\u4E3A\u4E86\u7528\u6237\u7684\u4FE1\u606F\u5B89\u5168\u3002</p></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>\u5982\u679C\u5728\u6D4F\u89C8\u5668\u73AF\u5883\u5916\uFF08\u4F8B\u5982\u5728\u670D\u52A1\u5668\u4E0A\uFF09\u4F7F\u7528 JavaScript\uFF0C\u5219\u4E0D\u5B58\u5728\u6B64\u7C7B\u9650\u5236\u3002\u73B0\u4EE3\u6D4F\u89C8\u5668\u8FD8\u5141\u8BB8\u5B89\u88C5\u53EF\u80FD\u4F1A\u8981\u6C42\u6269\u5C55\u6743\u9650\u7684\u63D2\u4EF6/\u6269\u5C55\u3002</p></div><h2 id="\u662F\u4EC0\u4E48\u8BA9-javascript-\u4E0E\u4F17\u4E0D\u540C\uFF1F" tabindex="-1">\u662F\u4EC0\u4E48\u8BA9 JavaScript \u4E0E\u4F17\u4E0D\u540C\uFF1F <a class="header-anchor" href="#\u662F\u4EC0\u4E48\u8BA9-javascript-\u4E0E\u4F17\u4E0D\u540C\uFF1F" aria-hidden="true">#</a></h2><ul><li>\u4E0E HTML/CSS \u5B8C\u5168\u96C6\u6210\u3002</li><li>\u7B80\u5355\u7684\u4E8B\uFF0C\u7B80\u5355\u5730\u5B8C\u6210\u3002</li><li>\u88AB\u6240\u6709\u7684\u4E3B\u6D41\u6D4F\u89C8\u5668\u652F\u6301\uFF0C\u5E76\u4E14\u9ED8\u8BA4\u5F00\u542F\u3002</li></ul><p>JavaScript \u662F\u5C06\u8FD9\u4E09\u4EF6\u4E8B\u7ED3\u5408\u5728\u4E00\u8D77\u7684\u552F\u4E00\u7684\u6D4F\u89C8\u5668\u6280\u672F\u3002</p><p>\u8FD9\u5C31\u662F\u4E3A\u4EC0\u4E48 JavaScript \u4E0E\u4F17\u4E0D\u540C\u3002\u8FD9\u4E5F\u662F\u4E3A\u4EC0\u4E48\u5B83\u662F\u7528\u4E8E\u521B\u5EFA\u6D4F\u89C8\u5668\u754C\u9762\u7684\u4F7F\u7528\u6700\u5E7F\u6CDB\u7684\u5DE5\u5177\u3002</p><div class="tip custom-block"><p class="custom-block-title">\u603B\u7ED3</p><ul><li>JavaScript \u6700\u5F00\u59CB\u662F\u4E13\u95E8\u4E3A\u6D4F\u89C8\u5668\u8BBE\u8BA1\u7684\u4E00\u95E8\u8BED\u8A00\uFF0C\u4F46\u662F\u73B0\u5728\u4E5F\u88AB\u7528\u4E8E\u5F88\u591A\u5176\u4ED6\u7684\u73AF\u5883\u3002</li><li>JavaScript \u4F5C\u4E3A\u88AB\u5E94\u7528\u6700\u5E7F\u6CDB\u7684\u6D4F\u89C8\u5668\u8BED\u8A00\uFF0C\u4E14\u4E0E HTML/CSS \u5B8C\u5168\u96C6\u6210\uFF0C\u5177\u6709\u72EC\u7279\u7684\u5730\u4F4D\u3002</li><li>\u6709\u5F88\u591A\u5176\u4ED6\u7684\u8BED\u8A00\u53EF\u4EE5\u88AB\u201C\u7F16\u8BD1\u201D\u6210 JavaScript\uFF0C\u8FD9\u4E9B\u8BED\u8A00\u8FD8\u63D0\u4F9B\u4E86\u66F4\u591A\u7684\u529F\u80FD\u3002\u5EFA\u8BAE\u6700\u597D\u4E86\u89E3\u4E00\u4E0B\u8FD9\u4E9B\u8BED\u8A00\uFF0C\u81F3\u5C11\u5728\u638C\u63E1\u4E86 JavaScript \u4E4B\u540E\u5927\u81F4\u7684\u4E86\u89E3\u4E00\u4E0B\u3002</li></ul></div>',29),l=[p];function c(o,s,n,v,d,h){return e(),i("div",null,l)}var _=a(t,[["render",c]]);export{J as __pageData,_ as default};
